import { StyleSheet } from 'react-native'

export const styles = StyleSheet.create({

    background: {
        backgroundColor: '#f0f0f0',
        position: 'relative',
        marginTop: 20
    },
    input: {
        backgroundColor: '#1e1e1e'
    }

})
